              if(p==10){var y=this.LINE_10;var a=this.GC_9;var b=this.GC_11}
              if(p==12){var y=this.LINE_12;var a=this.GC_12;var b=this.GC_13}
              if(p==13){var y=this.LINE_13;var a=this.GC_13;var b=this.GC_14}
              if(p==14){var y=this.LINE_14;var a=this.GC_13;var b=this.GC_15}
              if(p==15){var y=this.LINE_15;var a=this.GC_13;var b=this.GC_16}
              if(p==16){var y=this.LINE_16;var a=this.GC_16;var b=this.GC_17}
            // atualizando posição
              var start = {
                x:a.getBoundingClientRect().x,
                y:a.getBoundingClientRect().y,
              }
              var end   = {
                x:b.getBoundingClientRect().x,
                y:b.getBoundingClientRect().y,
              }
            // criando objeto 2d  
              this.canva = y.getContext('2d');
            // deletando anterior
              this.canva.clearRect(0,0,y.width,y.height);
            // iniciando canvas
              this.canva.beginPath();
            // atribuindo tamanho da tela do usuário
              this.canva.height = this.innerHeight;
              this.canva.width  = this.innerWidth;
            // modificando o tamanho da linha
              this.canva.lineWidth = 2
              this.canva.lineCap  = "round"
              this.canva.fill('evenodd')
            // modificando a cor da linha
              this.canva.strokeStyle = "#9e4a4a"
            // criando coodernadas 
              this.canva.moveTo((end.x+35),(end.y+35))
              this.canva.lineTo((start.x+35),(start.y+35))
            // renderizando canvas
              this.canva.stroke()
          },
        // função para ativar os grupos
          START_CICLE(l,b,x,y,z){
            // criando temporizador / ativando o grupo
              setTimeout(()=>{
                if (l=="L1")  { this.GPS.GP1.active=true  }
                if (l=="L11") { this.GPS.GP11.active=true }
              },1500)
            // chamando a animação dos grupos
              STARTING_POINT(b,x,y,z)
          },
        FIRSTEVENT(){
          // teste de console log
            console.log('dentro do primeiro evento')
            
          // iniciando anime.js, chamando a função e passando o elemento.
            ANIME_GROUPS(
              this.GROUP_2,
              this.GROUP_3,
              this.GROUP_4,
              this.GROUP_5,
              this.GROUP_6,
              this.GROUP_7,
              this.GROUP_8,
              this.GROUP_9,
              this.GROUP_10,
              this.GROUP_11,
              this.GROUP_12,
              this.GROUP_13,
              this.GROUP_14,
              this.GROUP_15,
              this.GROUP_16,
              this.GROUP_17
            )
          // teste
            EFFECT_CI(
              this.EFFECT_1,
              this.EFFECT_3,
              this.EFFECT_4,
              this.EFFECT_13
            )
            EFFECT_LI(
              this.LINE_1
            )

        }
    },
    watch: {
      //this.$nextTick(() => { });
      // quando houver atualizações
        G1PositionXY(){this.UPDATELINE(1)},
        G2PositionXY(){this.UPDATELINE(2)},
        G3PositionXY(){this.UPDATELINE(3)},
        G4PositionXY(){this.UPDATELINE(4)},
        G5PositionXY(){this.UPDATELINE(5)},
        G6PositionXY(){this.UPDATELINE(6)},
        G7PositionXY(){this.UPDATELINE(7)},
        G8PositionXY(){this.UPDATELINE(8)},
        G9PositionXY(){this.UPDATELINE(9)},
        G10PositionXY(){this.UPDATELINE(10)},
        G11PositionXY(){this.UPDATELINE(11)},
        G12PositionXY(){this.UPDATELINE(12)},
        G13PositionXY(){this.UPDATELINE(13)},
        G14PositionXY(){this.UPDATELINE(14)},
        G15PositionXY(){this.UPDATELINE(15)},
        G16PositionXY(){this.UPDATELINE(16)},
    },
  }
</script>

